import React from 'react';
import { Card, CardHeader, CardContent, CardActions, Typography, Button, Grid } from '@mui/material';
import { makeStyles } from '@mui/styles';
import image1 from '../images/image1.jpg';
import image2 from '../images/image2.png';
import image3 from '../images/image3.webp';
import image4 from '../images/image4.webp';
import image5 from '../images/image5.jpg';

const useStyles = makeStyles({
  card: {
    margin: "80px",
    padding: 0
  },
});

function Home() {
  const classes = useStyles();

  return (
    <div>
      <header className="py-5 bg-light border-bottom mb-4">
        <div className="container">
          <div className="text-center my-5">
            <h1 className="fw-bolder">Welcome to Home!</h1>
            <p className="lead mb-0">Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet</p>
          </div>
        </div>
      </header>
      <div className="container">
        <Grid container spacing={4}>
          <Grid item xs={12} lg={8}>
            <Card className={classes.card}>
              <a href="#!"><img className="card-img-top" src={image1} alt="..." /></a>
              <CardContent>
                <Typography variant="h5" component="h2">Featured Post Title</Typography>
                <Typography variant="body2" color="textSecondary">January 1, 2022</Typography>
                <Typography variant="body1">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Reiciendis aliquid atque, nulla? Quos cum ex quis soluta, a laboriosam. Dicta expedita corporis animi vero voluptate voluptatibus possimus, veniam magni quis!</Typography>
              </CardContent>
              <CardActions>
                <Button variant="contained" color="primary">Read more â†’</Button>
              </CardActions>
            </Card>
            {/* Other cards */}
          </Grid>
          <Grid item xs={12} lg={4}>
            <div className="card mb-4">
              <CardHeader title="Search" />
              <CardContent>
                <div className="input-group">
                  <input className="form-control" type="text" placeholder="Enter search term..." aria-label="Enter search term..." aria-describedby="button-search" />
                  <Button variant="contained" color="primary" id="button-search">Go!</Button>
                </div>
              </CardContent>
            </div>
            {/* Other cards */}
          </Grid>
        </Grid>
      </div>
      {/* Pagination */}
    </div>
  );
}

export default Home;
